B.lk=new A.b0(B.OJ,["We insist upon the highest standards for secure transactions and customer information privacy. Please read the following statement to learn about our information gathering and dissemination practices.\n\nBy mere use of the Website, you expressly consent to our use and disclosure of your personal information in accordance with this Privacy Policy. This Privacy Policy is incorporated into and subject to the Terms of Use.\n\nWe collect two kinds of information from you when you visit the Website and use our services.\n\nFirstly, we collect any information you voluntarily provide to us. For example, if you call or email us via the details provided on the \u2018Contact Us\u2019 page, we collect that information. Any and all information that you post or otherwise provide to \u201cDentist India Plus\u201d by means of this website shall be true and accurate, not misleading, and offered in good faith.\n\nWhenever you call for a medical consultation we keep record of your identity and contact details and of any medical conditions discussed, and guidance provided during your medical consultation, medical prescriptions, allowing for ease of use during future calls, diagnostic reports and other health records provided to us. Our unique Patient Management System guarantees privacy and confidential record keeping. All medical consultations including audio and video consultations are recorded and treated as your Electronic Health Records.\n\nSecondly, we automatically collect some information from you that\u2019s related to how you\u2019re accessing the Website. For example, we collect the Internet Protocol (IP) address of the domain you use to access the internet, the date and time you access our site, the pages you visit, and the Internet address of the website from which you linked directly to our site, as well as other similar features that are useful to us in providing the best possible content to you. This information is not shared with anyone beyond the support staff for this website, except when required by law or other law enforcement authorities and is used only as a source of anonymous statistical information.\n\nWe will occasionally ask you to complete optional online surveys. These surveys may ask you for contact information and demographic information (like pin code, location, age, or income level). We use this data to tailor your experience, providing you with content or services that we think you might be interested in and to display content according to your preferences.\n\nYou must promptly notify us along with your bank/credit card provider if your credit card, user name, or password is lost, stolen, or used without permission. In such an event, we will remove that credit card number, user name, or password from your account and update our records accordingly.\n\n","Cookies are useful for enabling the browser to remember information specific to a given User. We place both permanent and temporary cookies in your computer\u2019s hard drive. The cookies do not contain any of your personally identifiable information.\n\nWe use data collection devices such as \u201ccookies\u201d on certain pages of the Website to help analyse our web page flow, measure promotional effectiveness, and promote trust and safety\n\nWe also use cookies to allow you to enter your password less frequently during a session. Cookies can also help us provide information that is targeted to your interests. You are always free to decline our cookies if your browser permits, although in that case you may not be able to use certain features on the Website and you may be required to re-enter your password more frequently during a session. Additionally, you may encounter \u201ccookies\u201d or other similar devices on certain pages of the Website that are placed by third parties. We do not control use of cookies by third parties.\n\n","We may share personal information with our other corporate entities and affiliates to provide services to you, to help detect and prevent identity theft, fraud and other potentially illegal acts; correlate related or multiple accounts to prevent abuse of our services; and to facilitate to provide their services or joint or co-branded services that you request where such services are provided by more than one corporate entity.\n\n","We allow third-party advertising companies to display ads when you visit our Website. These companies may use information (not including username, address, email address, or telephone number) about your visits to this and other websites in order to provide advertisements about goods and services of interest to you.\n\n","By using the Website, availing our services and/ or by providing your information, you give your express consent to the collection and use of the information you disclose on the Website or while availing our services in accordance with this Privacy Policy, including but not limited to your consent for sharing your information as per this privacy policy.\n\nIf we decide to change our privacy policy, we will post those changes on this page so that you are always aware of what information we collect, how we use it, and under what circumstances we disclose it\n\n","The Site contains links to other websites. We are not responsible for the privacy practices or the content of such websites. We also make chat rooms, forums, message boards, and news groups available to you. Please understand that any information that is disclosed in these areas becomes public information. We have no control over its use and you should exercise caution when deciding to disclose your Personal Information.\n\n","You consent to receive/ communicate data, information, updates from \u201cDentist India Plus\u201d regarding the Services, through valid modes of communication which includes but not limited to emails, SMS, MMS, and other messages etc. We provide you with the opportunity to opt-out of receiving non-essential (promotional, marketing-related) communications from us after setting up an account with us."],t.l)
